//import { BrowserRouter as Router, Route, Switch} from 'react-router-dom';
import Content_home from "./content_home";
import Navbar from "./navbar";
import Login from "./login";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";

function App() {
  return (

    <div className="App">
      <Navbar/>

      <div className="content">

        <Switch>

          <Route exact path ="/">
            <Content_home/>
          </Route>

          <Route path = "/login">
            <Login/>
          </Route>
        </Switch>
      </div>
    </div>
  );
}

export default App;
